iting>\" text on stc screen\n    And click on Stop waiting button on stc screen\n    And Check Start waiting \"<startwaiting>\" text on stc screen\n    And click on Start waiting button again on stc screen\n    #And Check to verify stop meter \"<stopmeter>\" text on stc screen\n    #And click on Stop meter button on stc screen\n    #And check to verify Start meter \"<startmeter>\" text on stc screen\n    #And click on Start meter button on stc screen\n    And check to verify Add extra charges \"<addextracharges>\" on stc screen\n    And Verify customer image on stc screen\n    And verify customer name on stc screen\n    And message chat icon on stc screen\n    And check Card Payemnt image icon on stc screen\n    And check QR code image icon on stc screen\n    And click again on Meter expand button to close meter details on stc screen\n    Then Meter UI texts and buttons clicks are verified on stc screen\n\n    Examples: \n      | distance | waiting | tariff | tariffvalue | waitlabel | extra | discountper         | stopwaiting   | startwaiting | stopmeter  | startmeter | addextracharges   |\n      | Distance | Waiting | Tariff | T1          | Waiting   | Extra | Discount Percentage | Stop Waiting | Start Waiting | Start Meter | Start Meter | Add extra charges |\n\n  @OnboardingVerification\n  Scenario Outline: STC Screens UI and buttons clicks verifications\n    When Driver is on STC Screen and lets verify Waiting screens UI and texts fields\n    And move scroll up so that pick and drop address and screen UI are visible on stc screen\n    And verify stc screen current location icon\n    And verify stc screen start navigation icon\n    And verify stc screen pickup whole box\n    And verify stc screen dropoff whole box\n    And Check stc screen pickup zone text\n    And Check stc screen pickup address text\n    And check stc screen dropoff zone text\n    And check stc screen dropoff Address text\n    And check change dropoff address \"<dropoffaddress>\" text on stc screen\n    And check stc screen jobtype text\n    And check stc screen payment text\n    And check stc screen Booking text\n    And check stc screen tariff text\n    And check stc screen driver notes text\n    And check Clear button \"<clear>\" text\n    And move scroll down so that pick and drop address and screen UI are not visible on stc screen\n    Then STC Job screen UI elements are verified\n\n    Examples: \n      | clear | dropoffaddress |\n      | Clear | Change         |\n\n  @Onboarding\n  Scenario Outline: To move Job to Feedback screen and Job status become completed as driver click on clear button\n    When Driver Click on clear button\n    Then Driver move to the Feedback screen\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/10_JobSTC_Screen.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"STC Screen UI verification and Complete Testing","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@OnboardingVerification","id":"3940418b-ca74-4ef9-90d3-3666ece9df6b"}],"keyword":"Scenario Outline","name":"Meter UI and button clicks verifications on STC Screen","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"Meter Alerts comes as Driver move to the STC screen","id":"9f64bdb9-5d07-4376-b55b-0706d34c54e7"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"Verify Cost value and text on STC screen","id":"b0e5416d-2781-4113-a83d-6f3b1c0d16b8"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"check distance \"<distance>\" text on STC screen","id":"707677a0-14ba-4da3-8ae9-2826a39d7fac"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"check t ingDriversMessages\n  Scenario Outline: Drivers Messages verification on Accepted screen\n    Given Job has been received on DM8 and Accept it for Drivers Messages verifications\n    When click on message icon chat button on Accepted screen\n    And check Message whole alerts on Accepted screen\n    And check alerttitle \"<msg>\" text on Accepted screen\n    And click message chat icon button for second time on Accepted screen\n    And chech to verify message area on Accepted screen\n    And check to verify cancle \"<cnle>\" button text Accepted screen\n    And check to verify send \"<send>\" button text on Accepted screen\n    And click message chat icon to send message on Accepted screen\n    And click on message button on Accepted screen\n    And click on send button button on Accepted screen\n    And click on move job to waiting status for Chat message verification\n    Then All UI and text are verified on Accepted screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on Waiting screen\n    Given Job are in waiting status\n    When click on message icon chat button on Waiting screen\n    And check Message whole alerts on Waiting screen\n    And check alerttitle \"<msg>\" text on Waiting screen\n    And click message chat icon button for second time on Waiting screen\n    And chech to verify message area on Waiting screen\n    And check to verify cancle \"<cnle>\" button text Waiting screen\n    And check to verify send \"<send>\" button text on Waiting screen\n    And click message chat icon to send message on Waiting screen\n    And click on message button on Waiting screen\n    And click on send button button on Waiting screen\n    And click on move job to pob status for Chat message verification\n    Then All UI and text are verified on Waiting screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on POB screen\n    Given Job are in pob status\n    When click on message icon chat button on POB screen\n    And check Message whole alerts on POB screen\n    And check alerttitle \"<msg>\" text on POB screen\n    And click message chat icon button for second time on POB screen\n    And chech to verify message area on POB screen\n    And check to verify cancle \"<cnle>\" button text POB screen\n    And check to verify send \"<send>\" button text on POB screen\n    And click message chat icon to send message on POB screen\n    And click on message button on POB screen\n    And click on send button button on POB screen\n    And click on move job to stc status for Chat message verification\n    Then All UI and text are verified on POB screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on STC screen\n    Given Job are in stc status\n    When click on message icon chat button on STC screen\n    And check Message whole alerts on STC screen\n    And check alerttitle \"<msg>\" text on STC screen\n    And click message chat icon button for second time on STC screen\n    And chech to verify message area on STC screen\n    And check to verify cancle \"<cnle>\" button text STC screen\n    And check to verify send \"<send>\" button text on STC screen\n    And click message chat icon to send message on STC screen\n    And click on message button on STC screen\n    And click on send button button on STC screen\n    And click on move job to clear status for Chat message verification\n    Then All UI and text are verified on STC screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  #@OnboardingDriversMessages\n  #Scenario Outline: Drivers Messages verification on Clear screen\n    #Given Job are in clear status\n    #When click on message icon chat button on Clear screen\n    #And check Message whole alerts on Clear screen\n    #And check alerttitle \"<msg>\" text on Clear screen\n    #And click message chat icon button for second time on Clear screen\n    #And chech to verify message area on Clear screen\n    #And check to verify cancle \"<cnle>\" button text Clear screen\n    #And check to verify send \"<send>\" button text on Clear screen\n    #And click message chat icon to send message on Clear screen\n    #And click on message button on Clear screen\n    #And click on send button button on Clear screen\n    #And click on move job to Feedback status for Chat message verification\n    #Then All UI and text are verified on Clear screen\n\n    #Examples: \n     # | msg      | cnle   | send |\n      #| Messages | CANCEL | SEND |\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/15_DriverMessages.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Verify Drivers Messages Alert functionality on All Job Status","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@OnboardingDriversMessages","id":"9616cecf-de77-4d1a-b079-dc34db39e611"}],"keyword":"Scenario Outline","name":"Job creation from Evop for Drivers messages verification on All Job Status","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"Job request are given for Drivers Messages alert verification","id":"a28d99bb-45c8-44ba-9f25-979a59136e04"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"Job request are send to the server for Drivers messages verification","id":"98cdb537-87bd-4219-a0ad-8b9f4b11a2df"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome",     When Job request are send to the server for Job Map Navigation verification\n    Then new job has been created in order to check and verify Map Navigation in throughout job status\n\n  @OnboardingDriversMessages\n  Scenario Outline: Map Navigation verification on Accepted screen\n    Given Job has been received on DM8 and Accept it for Map Navigation verifications\n    When click on Map navigation button on Accepted screen\n    #And Verify Cost value and text for Map navigation on Accepted screen\n    #And check distance \"<distance>\" text for Map navigation on Accepted screen\n    #And check to verify miles covered values and text for Map navigation on Accepted screen\n    #And check waiting lable \"<waiting>\" text for Map navigation on Accepted screen\n    #And Check waiting time value for Map navigation on Accepted screen\n    And click on Back button to bring App back on screen for Map navigation on Accepted screen\n    And click on waiting button to move to waiting status for Map navigation on Accepted screen\n    Then Map Navigations all UI elments are verified on Accepted screen\n\n    Examples: \n      | distance | waiting |\n      | Distance | Waiting |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Map Navigation verification on Waiting screen\n    Given Job are in waiting status for Map Navigation verifications\n    When click on Map navigation button on Waiting screen\n    #And Verify Cost value and text for Map navigation on Waiting screen\n    #And check distance \"<distance>\" text for Map navigation on Waiting screen\n    #And check to verify miles covered values and text for Map navigation on Waiting screen\n    #And check waiting lable \"<waiting>\" text for Map navigation on Waiting screen\n    #And Check waiting time value for Map navigation on Waiting screen\n    And click on Back button to bring App back on screen for Map navigation on Waiting screen\n    And click on POB button to move to pob status for Map navigation on Waiting screen\n    Then Map Navigations all UI elments are verified on Waiting screen\n\n    Examples: \n      | distance | waiting |\n      | Distance | Waiting |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Map Navigation verification on POB screen\n    Given Job are in pob status for Map Navigation verifications\n    When click on Map navigation button on POB screen\n    #And Verify Cost value and text for Map navigation on POB screen\n    #And check distance \"<distance>\" text for Map navigation on POB screen\n    #And check to verify miles covered values and text for Map navigation on POB screen\n    #And check waiting lable \"<waiting>\" text for Map navigation on POB screen\n    #And Check waiting time value for Map navigation on POB screen\n    And click on Back button to bring App back on screen for Map navigation on POB screen\n    And click on STC button to move to stc status for Map navigation on POB screen\n    Then Map Navigations all UI elments are verified on POB screen\n\n    Examples: \n      | distance | waiting |\n      | Distance | Waiting |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Map Navigation verification on STC screen\n    Given Job are in STC status for Map Navigation verifications\n    When click on Map navigation button on STC screen\n    #And Verify Cost value and text for Map navigation on STC screen\n    #And check distance \"<distance>\" text for Map navigation on STC screen\n    #And check to verify miles covered values and text for Map navigation on STC screen\n    #And check waiting lable \"<waiting>\" text for Map navigation on STC screen\n    #And Check waiting time value for Map navigation on STC screen\n    And click on Back button to bring App back on screen for Map navigation on STC screen\n    And click on Clear button to move to Feedback screen so that all status are verified\n    Then Map Navigations all UI elments are verified on STC screen\n\n    Examples: \n      | distance | waiting |\n      | Distance | W
